				this.vacBonusc.visible = true;
				
				vacBonus = Math.log(1 + ((realVacs / 100) ** 0.666)) / Math.log(2) + 1;
				
				var tS = 10000000000
				var nextFlushed = flushed + vaccines;
				var P = 1000000000;
				
				realVacs = Math.floor((-tS + Math.sqrt(tS*tS + 8*P*flushed))/(2*P));
				
				var nextReal = Math.floor((-tS + Math.sqrt(tS*tS + 8*P*nextFlushed))/(2*P));
				
				var gain = nextReal - realVacs;
				
				if (language == 0) {
					this.getVcs.text = "to get " + format_short(gain, 0) + " Vaccines";
					
					this.vacBonusc.text = "增加你的BP和治愈增益 x" + format_short(vacBonus, 3);
				}
