		this.addEventListener("tick", autoBuy.bind(this));
		function autoBuy() {
			if (vpgrds[10][0] >= 1) {
				hasAuto[0] = 1;
			}
			if (hasAuto[0] == 1) {
				this.autoBuy_t.visible = true;
				if (language == 0) this.autoBuy_t.text = "自动购买!";
				if (language == 1) this.autoBuy_t.text = "Автопокуп!";
				this.autobIs.visible = true;
				this.autobDesc.visible = true;
				if (language == 0) this.autobDesc.text = "每一刻自动购买最便宜的建筑";
				if (language == 1) this.autobDesc.text = "Каждый тик покупает самое дешевое";
				this.tickSpeedt.visible = true;
				this.autoBBar.visible = true;
				
				if (hasAuto[1] == 1) {
					this.autobIs.gotoAndStop(1);
				}
				else {
					this.autobIs.gotoAndStop(0);
				}
				
				
				if (language == 0) {
					if (autoInter > 1) {
						this.tickSpeedt.text = "Tick 速度: " + Math.round(autoInter*100)/100 + "s";
					}
					else {
						this.tickSpeedt.text = "Tick 速度: " + Math.round(autoInter*1000) + "ms";
					}
				}
				else {
					if (autoInter > 1) {
						this.tickSpeedt.text = "Длит. тика: " + Math.round(autoInter*100)/100 + "с";
					}
					else {
						this.tickSpeedt.text = "Длит. тика: " + Math.round(autoInter*1000) + "мс";
					}
				}
				
				this.autoBBar.autobInter.gotoAndStop(Math.ceil(autoCur/autoInter*199));
			}
			else {
				this.autoBuy_t.visible = false;
				this.autobIs.visible = false;
				this.autobDesc.visible = false;
				this.tickSpeedt.visible = false;
				this.autoBBar.visible = false;
				this.autobIs.gotoAndStop(0);
				this.autoBBar.autobInter.gotoAndStop(0);
			}
			
			if (hasAuto[1] == 1) {
				autoCur += 1/fps;
				if (autoCur >= autoInter) {
					var amo = Math.floor(autoCur/autoInter);
					amo = Math.min(amo, 100);
					autoCur = autoCur%autoInter;
					
					for (var i = 0 ; i < amo ; ++i) {
						var t = [0, 0];
						t = findArgMin();
						if (t[1] == 1) {
							if (t[0] == 0) {
								buyM1();
							}
							else if (t[0] == 1) {
								buyM2();
							}
							else if (t[0] == 2) {
								buyM3();
							}
							else if (t[0] == 3) {
								buyM4();
							}
							else if (t[0] == 4) {
								buyM5();
							}
						}
						else if (t[1] == 2) {
							if (t[0] == 0) {
								buyS1();
							}
							else if (t[0] == 1) {
								buyS2();
							}
							else if (t[0] == 2) {
								buyS3();
							}
							else if (t[0] == 3) {
								buyS4();
							}
							else if (t[0] == 4) {
								buyS5();
							}
						}
						
						buildingsSetCosts();
						buildingsSetCosts2();
						setupAmounts2();
						
					}
				}
			}
		}
		
		
