		function findArgMin() {
			var t = [0, 1];
			var minCost = buildsMake[0][8];
			for (var s = 1 ; s < 5 ; ++s) {
				if (unlocked(s, 1)) {
					if (buildsMake[s][8] < minCost) {
						t = [s , 1];
						minCost = buildsMake[s][8];
					}
				}
			}
			for (var s = 0 ; s < 5 ; ++s) {
				if (unlocked(s, 2)) {
					if (buildsSell[s][8] < minCost) {
						t = [s , 2];
						minCost = buildsSell[s][8];
					}
				}
			}
			return t;
		}
		
		
		function unlocked(s, t) {
			if (t == 1) {
				if (s == 0) {
					return true;
				}
				if (s == 1) {
					if (buildsMake[0][0] >= 10) {
						return true;
					}
					else {
						return false;
					}
				}
				if (s == 2) {
					if (buildsMake[1][0] >= 10) {
						return true;
					}
					else {
						return false;
					}
				}
				if (s == 3) {
					if (buildsMake[2][0] >= 5) {
						return true;
					}
					else {
						return false;
					}
				}
				if (s == 4) {
					if (buildsMake[3][0] >= 1) {
						return true;
					}
					else {
						return false;
					}
				}
			}
			else if (t == 2) {
				if (s == 0) {
					return true;
				}
				if (s == 1) {
					if (buildsSell[0][0] >= 10) {
						return true;
					}
					else {
						return false;
					}
				}
				if (s == 2) {
					if (buildsSell[1][0] >= 10) {
						return true;
					}
					else {
						return false;
					}
				}
				if (s == 3) {
					if (buildsSell[2][0] >= 5) {
						return true;
					}
					else {
						return false;
					}
				}
				if (s == 4) {
					if (buildsSell[3][0] >= 1) {
						return true;
					}
					else {
						return false;
					}
				}
			}
			else return false;
		}
		
		
		
