		function checkOk_date(data) {
			if (data.minute >= 60) {
				var nextM = Math.floor(data.minute / 60);
				data.minute %= 60;
				data.hour += nextM;
			}
			if (data.hour >= 24) {
				var nextH = Math.floor(data.hour / 24);
				data.hour %= 24;
				data.day += nextH;
				weekDay += nextH;
				if (weekDay > 7) {
					weekDay %= 7;
				}
			}
			while (data.day > febDays(data.month, checkVis(data.year))) {
				data.day -= febDays(data.month, checkVis(data.year));
				data.month += 1;
			}
			if (data.month >= 13 && data.month%12 != 0) {
				var nextM = Math.floor(data.month / 12);
				data.month %= 12;
				data.year += nextM;
			}
			else if (data.month >= 13 && data.month%12 == 0) {
				var nextM = Math.floor((data.month-1) / 12);
				data.month = 12;
				data.year += nextM;
			}
		}
		
